@Pipe({ name: 'estatusExpedientePipe' })
export class EstatusExpedientePipe implements PipeTransform {
  transform(value: string): string {
    switch (value) {
      case '01':
        return 'PENDIENTE DE REVISIÓN';
      case '02':
        return 'REVISADO CONFORME';
      case '03':
        return 'INCOMPLETO';
      case '04':
        return 'INCONSISTENTE';
      default:
        return 'DESCONOCIDO';
    }
  }
}

